class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        if needle == "":
            return 0

        for i in range(len(haystack)-len(needle)+1):
            for j, e in enumerate(needle):
                if haystack[i+j] != e:
                    break
                elif j == len(needle)-1 and haystack[i+j] == e:
                    return i 

        return -1

